import DetailBox from '../../components/DetailBox';
import pointsIcon from '../../assets/pointsIcon.png';
import rewardsIcon from '../../assets/rewardsIcon.png';
import requestIcon from '../../assets/requestIcon.png';
import orderIcon from '../../assets/requestIcon.png';
import "./Dashboard.css";

export default function Dashboard() {
  return(
    <div>

  <div id="main">
    <h2>Dashboard</h2>
    <DetailBox logo={pointsIcon} text= "Total Points"/>
    <DetailBox logo={rewardsIcon} text="Points to Redeem" />
    <DetailBox logo={requestIcon} text="Pending Requests" />
    <DetailBox logo={requestIcon} text="Pending Requests" />
  </div>
    </div>

  );

}
